import "../Landing Page/home.css";
import React from "react";

const Home = () => {
    return (
        <section className="showcase">
        <div className="body">
            <h1 className="heading">Intriguing hook will go here.</h1>
            <h2 className="desc">An app that provides something that links <br/> with the intrigue mentioned above.</h2>
            <ul className="buttons">
                <li><img className="button-item" src={require('../Landing Page/Preview.png')} alt=""></img></li>
                <li><img className="button-item" src={require('../Landing Page/App Store.png')} alt=""></img></li>
            </ul>
            <img className="fire" src={require('../Landing Page/Fire.png')} alt=""></img>
        </div>
        <div>
            <img className="phone-ex" src={require('../Landing Page/Phone Ex.png')} alt=""></img>
        </div>
        </section>
    )
};

export default Home;
